import React from 'react';
import { Div, Img } from '../../../assets/style';
import { Tabs } from 'antd';
import "./index.css";
const { TabPane } = Tabs;



const Tab = () => {
  return (
    <Tabs defaultActiveKey="2">
    <TabPane
      tab={
        <span>

          Tab 1
        </span>
      }
      key="1"
    >
      Tab 1
    </TabPane>
    <TabPane
      tab={
        <span>

          Tab 2
        </span>
      }
      key="2"
    >
      Tab 2
    </TabPane>
  </Tabs>


  )
}





export default Tab;
